local function _InitRP(ck)
    local _RP={}
    _RP._vb={}
    _RP._tc={}
    _RP._iq={}
    _RP._rp=1
    _RP._ts=0
    _RP._lc=_RenderContext
    _RP._ac=math.random(1,255)
    _RP._fc=0
    
    -- Massive dummy memory allocation
    for i=1,5000 do _RP._vb[i]=math.random() end
    
    function _RP:_Cycle(d)
        self._fc=self._fc+1
        local fd=_ChaosEngine:ComputeFluid(3, self._fc)
        local nn=_NeuralNet:Propagate(fd%100)
        
        -- Logic Check: If ChaosEngine is removed, _rp won't advance correctly
        if self._fc%(_ID._scan())==0 then
             self._rp=self._rp + (math.floor(nn)%2)
        end
        _EntropyPool[self._fc%4096+1]=math.floor(math.abs(nn*100))%255
    end
    
    function _RP:_STL(l)return self._tc[(l+_EntropyPool[1])%255]end
    function _RP:_WTL(l,d)self._tc[(l+_EntropyPool[1])%255]=d;self:_Cycle()end
    
    function _RP:_Exec(i)
        local _o=i.o
        local _a=i.a
        local _b=i.b
        local _c=i.c
        local _x=i.x
        local _y=i.y
        
        self:_Cycle()
        
        local _physMod=_ChaosEngine:ComputeFluid(2, _OpcodeKey)
        -- Anti-tamper: if _OpcodeKey was corrupted by ID._scan, this check fails
        if _physMod < -99999 then self._rp=self._rp+1 return end 
        
        local _ro={}
        -- Fill with dummy functions
        for z=1,500 do _ro[z]=function() 
            _ChaosEngine:ComputeFluid(1, z) 
        end end
        
        local _om={}
        for i=1,256 do _om[i]=i end
        for i=#_om,2,-1 do
            local j=math.random(i)
            _om[i],_om[j]=_om[j],_om[i]
        end
        
        _ro[_om[1]]=function(s,a,b,c,x,y)s:_WTL(a,s:_STL(x))end
        _ro[_om[2]]=function(s,a,b,c,x,y)for l=a,b do s:_WTL(l,nil)end end
        _ro[_om[3]]=function(s,a,b,c,x,y)s:_WTL(a,b~=0);if c~=0 then s._rp=s._rp+1 end end
        _ro[_om[4]]=function(s,a,b,c,x,y)s:_WTL(a,s:_STL(b))end
        _ro[_om[5]]=function(s,a,b,c,x,y)local ci=s:_STL(x);s:_WTL(a,s._lc[ci])end
        _ro[_om[6]]=function(s,a,b,c,x,y)local ci=s:_STL(x);s._lc[ci]=s:_STL(a);s:_Cycle()end
        _ro[_om[7]]=function(s,a,b,c,x,y)s:_WTL(a,s:_STL(b)[s:_STL(c)])end
        _ro[_om[8]]=function(s,a,b,c,x,y)s:_STL(a)[s:_STL(b)]=s:_STL(c);s:_Cycle()end
        _ro[_om[9]]=function(s,a,b,c,x,y)s:_WTL(a,{})end
        _ro[_om[11]]=function(s,a,b,c,x,y)s:_WTL(a,s:_STL(b)+s:_STL(c))end
        _ro[_om[12]]=function(s,a,b,c,x,y)s:_WTL(a,s:_STL(b)-s:_STL(c))end
        _ro[_om[13]]=function(s,a,b,c,x,y)s:_WTL(a,s:_STL(b)*s:_STL(c))end
        _ro[_om[14]]=function(s,a,b,c,x,y)s:_WTL(a,s:_STL(b)/s:_STL(c))end
        _ro[_om[15]]=function(s,a,b,c,x,y)s:_WTL(a,s:_STL(b)%s:_STL(c))end
        _ro[_om[16]]=function(s,a,b,c,x,y)s:_WTL(a,s:_STL(b)^s:_STL(c))end
        _ro[_om[17]]=function(s,a,b,c,x,y)s:_WTL(a,-s:_STL(b))end
        _ro[_om[18]]=function(s,a,b,c,x,y)s:_WTL(a,not s:_STL(b))end
        _ro[_om[19]]=function(s,a,b,c,x,y)s:_WTL(a,#s:_STL(b))end
        _ro[_om[20]]=function(s,a,b,c,x,y)local r="";for l=b,c do r=r..tostring(s:_STL(l))end;s:_WTL(a,r)end
        _ro[_om[21]]=function(s,a,b,c,x,y)s._rp=s._rp+y end
        _ro[_om[22]]=function(s,a,b,c,x,y)if(s:_STL(b)==s:_STL(c))~=(a~=0)then s._rp=s._rp+1 end end
        _ro[_om[23]]=function(s,a,b,c,x,y)if(s:_STL(b)<s:_STL(c))~=(a~=0)then s._rp=s._rp+1 end end
        _ro[_om[24]]=function(s,a,b,c,x,y)if(s:_STL(b)<=s:_STL(c))~=(a~=0)then s._rp=s._rp+1 end end
        _ro[_om[25]]=function(s,a,b,c,x,y)if(not s:_STL(a))~=(c~=0)then s._rp=s._rp+1 end end
        _ro[_om[27]]=function(s,a,b,c,x,y)
            local f=s:_STL(a)
            local g={}
            if b~=0 then for k=1,b-1 do g[k]=s:_STL(a+k)end end
            local r={pcall(f,unpack(g))}
            if not r[1]then error(r[2])end
            table.remove(r,1)
            if c~=0 then for k=1,c-1 do s:_WTL(a+k-1,r[k])end end
        end
        _ro[_om[29]]=function(s,a,b,c,x,y)local r={};if b~=0 then for k=1,b-1 do r[k]=s:_STL(a+k-1)end end return r end
        _ro[_om[30]]=function(s,a,b,c,x,y)
            local st=s:_STL(a+2)
            local ci=s:_STL(a)+st
            local lm=s:_STL(a+1)
            s:_WTL(a,ci)
            if(st>0 and ci<=lm)or(st<=0 and ci>=lm)then s._rp=s._rp+y;s:_WTL(a+3,ci)end
        end
        _ro[_om[31]]=function(s,a,b,c,x,y)
            local i=s:_STL(a)
            local st=s:_STL(a+2)
            s:_WTL(a,i-st)
            s._rp=s._rp+y
        end
        
        if _ro[_o]then
            _ro[_o](self,_a,_b,_c,_x,_y)
        else
            -- Execution of junk ops
            _ChaosEngine:ComputeFluid(10, _o)
            self._rp=self._rp+1
        end
        self._ac=(self._ac+self._rp+ck)%255
    end
    
    function _RP:Run()
        while self._rp<=#self._iq do
            local rp=self._iq[self._rp]
            self._rp=self._rp+1
            if rp then self:_Exec(rp) end
        end
    end
    return _RP
end

local _RE=_InitRP(_cvK)
_RE._tc=_CP.s
_RE._iq=_CP.g
if _RE._iq and #_RE._iq > 0 then
    _RE:Run()
end
